import React from 'react'
import { withStyles } from '@material-ui/core';
import FormInput from "./formInput/FormInput";

const useStyles = theme => ({
  container: {
    display: "flex",
    position :"fixed",
    alignItems:'center',
    width: '100vw',
    height: '100vh',
  },

  right: {
    padding: '15px',
    backgroundColor: '#424242',
    borderRadius: '20px',
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      width: '100%',
      height: '100%',
      borderRadius: '0px',
      overflowY: 'auto',
    },
  },

  left: {
    width: "70%",
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      display: 'none',
      width: "0vw",
    },

  },

})
export class SigninJs extends React.Component {

  inputs = [
    {
      id: 1,
      name: "username",
      type: "text",
      placeholder: "Username",
      required: true,
    },
    {
      id: 4,
      name: "password",
      type: "password",
      placeholder: "Password",
      errorMessage:
        "Password must be greater than 8 characters and must contain letters and numbers",
      label: "Password",
      pattern: `^(?=.*[0-9])(?=.*[a-zA-Z])[a-zA-Z0-9]{8,40}$`,
      required: true,
    },
  ];
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.container}>
        <div className={classes.left}>This is left</div>
        <div className={classes.right}>This is right</div>
      </div>
    )
  }
}

export default withStyles(useStyles)(SigninJs)
